4214Font4\" data-bltIndnt=\"0\" style=\"line-height:1.107;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384214CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384214Font4\"  >Physical items containing information of designs, components or their use&nbsp;\n</span ></li >\n<li  class=\"text384214Font4\" data-bltIndnt=\"0\" style=\"line-height:1.107;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384214CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384214Font4\"  >Publications, manuals, standard operating procedures, checklists, webforms etc\n</span ></li >\n<li  class=\"text384214Font4\" data-bltIndnt=\"0\" style=\"line-height:1.107;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384214CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384214Font4\"  >Intellectual information or knowledge acquired by individuals, and&nbsp;\n</span ></li >\n<li  class=\"text384214Font4\" data-bltIndnt=\"0\" style=\"line-height:1.107;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text384214CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text384214Font4\"  >Software or systems and networks on which information is stored, processed or communicated \n</span ></li >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
